    def opened(self):
        try:
            self.fname = QFileDialog.getOpenFileName(self, 'Open file', './', filter='*.txt')
            f = open(self.fname[0], 'r', encoding='UTF8')
            
            #초기화
            self.listWidget_nickname.clear()
            self.listWidget_date.clear()
            self.nickname = ""
            self.real = ""
            self.filtered_real = ""
            self.all_date = ""
            self.all_date_save = ""
            self.nicknames_save = ""
            self.all_count = 0

            f.readline()

            if "-" in f.readline():
                operation_system = "windows"
            else:
                operation_system = "android"
                f.readline()
            f.readline()

            lines = f.readlines()

            #[날짜, 닉네임, 시간, 내용]
            real = list()
            #날짜
            all_date = list()

            if operation_system == "windows":
                for word in lines:
                    #닉네임
                    each = list()

                    if len(word) > 30 and word[:6].strip("-") == "":
                        #날짜 형태 XXXX년 X월 X일
                        date = word[16:word.find("-", 17)-5]
                        all_date.append(date)
                        continue
                    elif word[0]=="[" and word.count("[") > 1 and word.count("] [") > 0:
                        each.append(date)

                        #닉네임
                        each.append(word[1:word.find("] [")])
                        
                        #시간
                        each.append(word[word.find("] [")+3:word.find("]", word.find("] [")+2)])
                        
                        #글
                        each.append(word[word.find("]", word.find("] [")+2) + 2:])
                        
                    #빈칸은 무시하기
                    elif word == "\n":
                        continue
                    elif word.find("님이 들어왔습니다.") != -1 or word.find("님이 나갔습니다.") != -1 or word.find("님을 내보냈습니다.") != -1 or word.find("채팅방 관리자가 메시지를 가렸습니다.") != -1 or word.find("님을 초대하였습니다.") != -1:
                        continue
                    else:
                        #전에 있던 값에 해당 문장을 합치기
                        real[-1][3] = real[-1][3] + word
                        continue

                    real.append(each)
            else:
                for word in lines:
                    #닉네임
                    each = list()
                    # 쉼표 없고 글을 공백 기준으로 나누면 5개이고 '오'라는 글자가 들어가고 4번째 글자는 년이고 문장의 첫 4글자가 숫자라면!
                    if "," not in word and len(word.split()) == 5 and "오" in word and word[4] == "년" and word[:4].isnumeric():
                        #날짜 형태 XXXX년 X월 X일
                        date = word[:word.find("오")-1]
                        all_date.append(date)
                        continue
                    #메시지들 무시
                    elif " : " not in word and word.find("님이 들어왔습니다.") != -1 or word.find("님이 나갔습니다.") != -1 or word.find("님을 내보냈습니다.") != -1 or word.find("채팅방 관리자가 메시지를 가렸습니다.") != -1 or word.find("님을 초대하였습니다.") != -1:
                        continue
                    #빈칸 무시
                    elif word == "\n":
                        continue
                    #전에 있던 값에 해당 문장 합치기
                    elif " : " not in word:
                        real[-1][3] = real[-1][3] + word
                        continue
                    elif word.count(" : ") > 0:
                        each.append(date)

                        #닉네임
                        if word[word.find(",")+2:word.find(" : ")] == "":
                            each.append("공백아이디유저")
                        else:
                            each.append(word[word.find(",")+2:word.find(" : ")])

                        #시간
                        each.append(word[word.find("오"):word.find(",")])

                        #글
                        each.append(word[word.find(" : ")+3:])
                    else:
                        continue
                    
                    real.append(each)

            self.nicknames = sorted(set([i[1] for i in real]))
            self.nicknames_save = sorted(set([i[1] for i in real]))
            self.real = real
            self.all_date = all_date
            self.all_date_save = all_date

            #리스트에 보여주기
            for nickname in self.nicknames:
                self.listWidget_nickname.addItem(nickname)

            for date in self.all_date:
                self.listWidget_date.addItem(date)

            self.tableWidget.setRowCount(len(self.real))

            # 개수 표현하기
            self.all_count = len(self.real)
            self.label_count.setText(str(len(self.real))+" 개")

            format_str = '%Y년 %m월 %d일' # The format

            for index, value in enumerate(self.real):
                #날짜
                #날짜 형태 XXXX년 XX월 XX일 일로 바꿔서 테이블에서 정렬 가능하게 만들기
                datetime_obj = datetime.datetime.strptime(value[0], format_str)
                self.tableWidget.setItem(index, 0, QTableWidgetItem(str(datetime_obj.date())))
                #시간
                self.tableWidget.setItem(index, 1, QTableWidgetItem(value[2]))
                #닉네임
                self.tableWidget.setItem(index, 2, QTableWidgetItem(value[1]))
                #내용
                self.tableWidget.setItem(index, 3, QTableWidgetItem(value[3]))
                
            f.close()

        except:
            reply = QMessageBox.warning(self, '불러오기 오류', '형식에 맞지 않는 카카오톡 글 입니다!', QMessageBox.Yes, QMessageBox.Yes)

    def save_file_to_txt(self):
        #동일한 이름을 가진 것이 있을 경우
        try:
            name = QFileDialog.getSaveFileName(self, 'Save File', './', filter='*.txt')
            with open(name[0], 'w', encoding='UTF8') as file:
                for words in self.filtered_real:
                    file.write(" | ".join(words))
            #저장완료 메시지 보여주기
            reply = QMessageBox.information(self, '저장 확인', '저장이 완료되었습니다!', QMessageBox.Yes, QMessageBox.Yes)
        except:
            reply = QMessageBox.warning(self, '저장 확인', '저장 중 오류가 발생했습니다!', QMessageBox.Yes, QMessageBox.Yes)

    def save_file_to_csv(self):
        try:
            name = QFileDialog.getSaveFileName(self, 'Save File', './', filter='*.csv')
            with open(name[0], 'w', newline='') as csvfile:
                fieldnames = ['날짜', '닉네임', '시간', '카톡내용']
                writer = csv.DictWriter(csvfile, fieldnames=fieldnames)

                writer.writeheader()
                for words in self.filtered_real:
                    writer.writerow({'날짜': words[0], '닉네임': words[1], '시간': words[2], '카톡내용': words[3]})

            #저장완료 메시지 보여주기
            reply = QMessageBox.information(self, '저장 확인', '저장이 완료되었습니다!', QMessageBox.Yes, QMessageBox.Yes)
        except:
            #에러 메시지 보여주기
            reply = QMessageBox.warning(self, '저장 확인', '저장 중 오류가 발생했습니다!', QMessageBox.Yes, QMessageBox.Yes)

    def menu_information(self):
        reply = QMessageBox.information(self, '제작자', 'Made By Null\nConnect : cwadven@naver.com', QMessageBox.Yes, QMessageBox.Yes)

